import React from 'react'
import Nav from '../Nav.js'

export default class LandingPage extends React.Component{
  state={
    clicked: false
  }

  menuClick = (e) => {
    e.preventDefault()
    if(this.state.clicked === false){
      this.setState({
        clicked: true
      })
    }
  }
  render(){
    return(
      <div >
      <Nav menuClick={this.menuClick}  />
        <div className="landing-page">
          <div className="columns1">
          {this.state.clicked ? <div class="ui visible sidebar">Menu item</div> : null}
            LandingPage
          </div>
          <div className="columns2">
            LandingPage
          </div>
        </div>
      </div>
    )
  }
}
